                                "description": "A perfect order exists in the last ten surahs, in their inter-relationships, and is indicative of the Quran overall. \r\nThrough the common thread shared in the legacy of Ibrahim, they serve as examples of this Divine unparalleled order. \r\n00:14 \tPerfect Order of the Last Ten Surahs of the Quran \r\n00:37\tSurah AI-Fi'l (105)\r\n01:20\tProphet Ibrahim (AS) duaa\r\n02:09\tSurah Quraysh (106)\r\n05:09\tSurah AI-Ma'oon (107)\r\n07:57\tSurah AI-Kawthar (108)\r\n09:19\tSurah AI-Kafiroon (109)\r\n10:46\tSurah AI-Nasr (110)\r\n13:18\tSurah Lahba (AI-Masad) (111)\r\n13:49\tSequence of the Surahs above\r\n15:57\tSurah AI-Ikhlas (112)\r\n17:25\tSurah AI-Falaq (113)\r\n17.48\tSurah An-Naas (114)\r\n19:20\tExamples of the organizations of the Quran\r\n20;50\tWhat happens inside a Surah\r\n21:05\tSymmetry of Surah Yusuf (12)\r\n24:55\tSurah Rahman (55) vs Sura Wakiya (56)\r\n27:04\tConnectivity within and between Surahs of the Quran\r\n28:36\tBalance of the characters in Surah Yusuf\r\n28:55\tYusuf's 2 qualities - humility and confidence \r\n36:34\tHumility, arrogance and confidence in Islam\r\n48:00\tSymmetry of Surah Al-Hijr (15)",
                                "icon_url": "https://files.bayyinahtv.com/assets/icons/video.png",
