                                                "description": "We learn the Prophet is killing himself with grief over his concern for people who continue to disbelieve while Allah consoles him.\r\n\r\n00:16\t Ayah 6 of Surah Kahf\r\nفَلَعَلَّكَ بَاخِعٌ نَفْسَكَ عَلَىٰ آثَارِهِمْ إِنْ لَمْ يُؤْمِنُوا بِهَٰذَا الْحَدِيثِ أَسَفًا\r\n00:38\tAn الْتِفات  (transition)    \r\n07:59\tThe worry of the prophet (peace be upon him) \r\n08:14\tReminder: Three transitions have happened in modern society leading to a fourth transition.\r\n10:08\tLinguistics of the Ayah - Imam Razi \r\n10:24\tThe word  فَلَعَلَّكَ\r\n22:43\tThe word   بَاخِعٌ  - Linguistic sources\r\n27:28\tIbn Ashoor on the Imagery used\r\n31:24\tMore Benefits in this Verse\r\n35:54\tThe words   آثَارِ هِمْ\r\n38:36\tThe word   عَلَىٰ \r\n39:37\tWhy use the word hadith?  بِهَٰذَا الْحَدِيثِ أَسَفًا\r\n45:07\tOverview from Ibn Ashoor\r\n47:05\tThe word   أَسَفًا\r\n49:36\tSurah at-Tawba 9:128  لَقَدْ جَاءَكُمْ رَسُولٌ مِنْ أَنْفُسِكُمْ عَزِيزٌ عَلَيْهِ مَا عَنِتُّمْ",
