                                                "description": "The 7th and 8th ayaat, a proclamation of the life of this world as a test removes all doubt that the beautification of creation itself serves Allah’s greater purpose and pose trials for mankind.\r\n\r\n00:19\tThis video discusses the seventh and eighth ayahs of Surah Kahf\r\nإِنَّا جَعَلْنَا مَا عَلَى الْأَرْضِ زِينَةً لَهَا لِنَبْلُوَهُمْ أَيُّهُمْ أَحْسَنُ عَمَلًا\r\n02:40\tWhy is   إِنَّا جَعَلْنَا مَا عَلَى الْأَرْضِ زِينَةً لَهَا   there\r\n06:00\tThe Human’s Quest for Beauty\r\n20:03\tAllah's explained His reason for why are people turning away from the Prophet (pbuh)\r\n20:03\tBurhan Al-Deen Al-Biqa’ai (A Mufassir) says\r\n21:04\tIbn Ashoor says\r\n24:37\tAbu Zahra says \r\n25:20\tWhat is the connection of this ayah with the ayaat before it?\r\n27:44\tThe fitnah of Dajjal\r\n30:34\tMeanings and Implications of  إِنَّا   in the ayah\r\n30:56\tIbn Ashoor says إِنَّا is being used to confirm to the Prophet (pbuh) that the world is not some mild kind of beauty\r\n31:26\tStrange balance between the Prophet (pbuh) on the one hand being comforted and on other hand being toughed up\r\n33:05\tQuran is enough.  It is  Allah's final Word\r\n36:09\tHadith - Prophet (pbhu) says, People of Quran, don’t become lax with the Quran … so that you may be successful",
